description:
Brachyspira spp. are oxygen-tolerant anaerobes that colonize the intestines of some mammalian and avian species. The 7 currently described Brachyspira species differ in enteropathogenicity from known important pathogens of livestock to presumed commensals.;
;
Brachyspira pilosicoli (strain ATCC BAA-1826 / 95/1000) is an anaerobic Gram-negative bacterium which colonizes the large intestine of various species of birds and mammals, including humans. It causes "intestinal spirochetosis", a condition characterized by mild colitis, diarrhea and reduced growth. The three Brachyspira species shared 1,087 genes and showed evidence of extensive genome rearrangements. Despite minor differences in predicted protein functional groups, the species had many similar features including core metabolic pathways. Genes distinguishing B. pilosicoli from B. hyodysenteriae included those for a previously undescribed bacteriophage that may be useful for genetic manipulation, for a glycine reductase complex allowing use of glycine whilst protecting from oxidative stress, and for aconitase and related enzymes in the incomplete TCA cycle, allowing glutamate synthesis and function of the cycle during oxidative stress. B. pilosicoli had substantially fewer methyl-accepting chemotaxis genes than B. hyodysenteriae and hence these species are likely to have different chemotactic responses that may help to explain their different host range and colonization sites. B. pilosicoli lacked the gene for a new putative hemolysin identified in B. hyodysenteriae WA1. (adapted from PMID: 20625514).

Escherichia coli is a Gram-negative straight rod, which either uses peritrichous flagella for mobility or is nonmotile. It is a facultatively anaerobic chemoorganotroph capable of both respiratory and fermentative metabolism. E.coli serves a useful function in the body by suppressing the growth of harmful bacterial species and by synthesising appreciable amounts of vitamins. It is an important component of the biosphere. It colonizes the lower gut of animals and survives when released to the natural environment, allowing widespread dissemination to new hosts. Pathogenic E.coli strains are responsible for infection of the enteric, urinary, pulmonary and nervous systems. Comparison of 20 E.coli/Shigella strains shows the core genome to be about 2000 genes while the pan-genome has over 18,000 genes. There are multiple, striking integration hotspots that are conserved across the genomes, corresponding to regions of abundant and parallel insertions and deletions of genetic material.;
;
E.coli O157:H7, phylogroup E, is a enterohemorrhagic strain producing large quantities of one or more related, potent toxins that cause severe damage to the lining of intestine. These toxins are closely related to the toxin produced by Shigella dysenteriae. The acute disease caused by the bacterium is called hemorrhagic colitis and is characterized by severe cramping and diarrhea. Undercooked or raw hamburger has been implicated in nearly all documented outbreaks and in other sporadic cases. Raw milk was the vehicle in a school outbreak in Canada.

