E.coli HS is a human commensal isolate that was originally isolated from a laboratory scientist at the Walter Reed Army Institute of Research. In human challenge experiments, strain HS colonized the human gastrointestinal tract with no overt signs of disease. The genome sequence of strain HS represents the genomic baseline for colonization of the human gastrointestinal tract. This isolate is serotype O9, phylogroup A, motile, competent and amenable to genetic manipulation.

Escherichia coli is a Gram-negative straight rod, which either uses peritrichous flagella for mobility or is nonmotile. It is a facultatively anaerobic chemoorganotroph capable of both respiratory and fermentative metabolism. E.coli serves a useful function in the body by suppressing the growth of harmful bacterial species and by synthesising appreciable amounts of vitamins. It is an important component of the biosphere. It colonizes the lower gut of animals and survives when released to the natural environment, allowing widespread dissemination to new hosts. Pathogenic E.coli strains are responsible for infection of the enteric, urinary, pulmonary and nervous systems. Uropathogenic strains of Escherichia coli (UPEC) are the most common cause of non-hospital-acquired urinary tract infections, responsible for 70-90% of the 7 million cases of acute cystitis and 250,000 cases of pyelonephritis reported annually in the United States.;
;
Strain O6:H1:K? belongs to phylogroup B2. It was isolated at the University of Maryland Hospital.

Acid-fast, obligate aerobic, non-motile, rod-shaped bacterium, this is the causative agent of tuberculosis. Tuberculosis is, to this day, according to the WHO, the leading killer of adults, with approximately 2 million deaths annually worldwide. It is estimated that 8 million people are infected each year. A large part of its success as a pathogen is due to its ability to persist in a dormant or latent form for years or even decades, with a concomitant absence of clinical symptoms. This non-replicating persistent form is refractory to most drugs, it may be induced by hypoxia (oxygen depletion) and/or nitric oxide exposure. Up to one-third of the world's population is thought to be latently infected. An additional problem is the emergence of drug resistant strains, mainly because people do not complete their treatment plans or have been incorrectly treated and so have remained infectious.;
;
The highly attenuated H37Ra (and the already sequenced virulent H37Rv) strains of M. tuberculosis were derived by serial passaging of the H37 clinical isolate through laboratory media. The genetic basis for the avirulent phenotype of M. tuberculosis H37Ra in animal models is not known. Since the H37Ra strain does not revert to a virulent phenotype on passaging through animals, it is likely that the former has acquired multiple point mutations or small deletions/rearrangements in genes crucial for virulence. Some differences between the two strain have been noted. Although both H37Rv and H37Ra are able to infect macrophages equally, only H37Rv and not H37Ra was able to grow intracellularly as well as cause significant mitochondrial damage leading to necrosis. The aggregation of mycobacteria into structures known as "cords" has long been associated with virulence. Comparative gene expression analysis recently identified 22 genes that were consistently expressed at higher levels in H37Rv (a cording strain) than in H37Ra (a non-cording strain) under a variety of growth conditions. More than half of these genes were either involved in lipid metabolism or were putative cell membrane proteins (adapted from PubMed 17435310). Comparisons between H37Ra, H37Rv and the clinical strain CDC 1551 identified 76 single nucleotide polymorphisms in 32 genes, among which mutations affecting transcription factors and/or global metabolic regulations related to in vitro survival under aging stress, and mutations affecting cell envelope, primary metabolism, in vivo growth as well as variations in the PE/PPE/PE-PGRS family genes (encoding proteins with functions such as virulence, fibronectin binding, and cell surface antigenic variations) may underlie the basis of virulence attenuation (adapted from PMID 18584054).;
;
Mycobacteria have an unusual outer membrane approximately 8nm thick, despite being considered Gram-positive. The outer membrane and the mycolic acid-arabinoglactan-peptidoglycan polymer form the cell wall, which constitutes an efficient permeability barrier in conjunction with the cell inner membrane.

Shewanella are facultatively anaerobic, Gram-negative bacteria, motile by polar flagella, rod-like, and generally associated with aquatic or marine environments. They are capable of using a variety of compounds as electron acceptors, including oxygen, iron, manganese, uranium, nitrate, nitrite, fumarate, to name but a few. This ability makes Shewanella important for bioremediation of contaminated metals and radioactive wastes. The genus Shewanella comprises 36 recognized and hundreds of uncharacterized cultivable species.;
;
Shewanella sediminis HAW-EB3 was isolated from sediment taken at a depth of 215 meters from an unexploded-ordinance-dumping site 50 nautical miles from Halifax Harbor, in the Atlantic Ocean. This organism is able to degrade hexahydro-1,3,5-trinitro-1,3,5-triazine (RDX) anaerobically at 10 degrees Celsius . RDX is a member of a family of nitramine compounds which are used in the production of explosives. These chemicals are toxic and can be a major source of contamination of marine and freshwater sediments. Shewanella sediminis HAW-EB3 (NCIMB 14036, DSM 17055) is the type strain and the genome sequence will provide information on the production and regulation of proteins involved in the degradation of RDX.

The Xanthomonadaceae are a family of Gram negative bacteria belonging to the order Xanthomonadales in the gammaproteobacteria. They are typically characterized as environmental organisms and are found in soil and water, as well as plant tissues. Many Xanthomonadaceae, especially species from the genera Xanthomonas and Xylella, cause plant diseases. Only one, Stenotrophomonas maltophilia, has isolates known to be opportunistic human pathogens.;
;
Xylella fastidiosa strain Temecula was isolated from a naturally infected grapevine with Pierce's disease in a wine-grape-growing region of California. This disease is characterized by wilted, shriveled, raisin-like fruits and scorched leaves that detach, leaving bare petioles attached to the canes. This devastating disease is a major threat to the viability of the California wine industry.
